import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import BlogContent from './BlogContent';

class BlogPage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <React.Fragment>
                <BlogContent/>
            </React.Fragment>
        );
    }
}

export default withRouter(BlogPage);
